import React, { useState, useEffect } from 'react';
import './EditProfile.css';
import { useNavigate } from 'react-router-dom';
import Axios from 'axios';

function EditProfile() {
    const navigate =  useNavigate();

    const [formData, setFormData] = useState({
       
        password: "",
        name: "",
        contact_info: "",
        confirm_password: "",
      });
    
      const [isLoggedIn, setIsLoggedIn] = useState(false);
      const [errormsg, setErrormsg] = useState("");
    
      const {  password, name, contact_info,confirm_password } = formData;
    
      const onChangeInput = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
      };
    

  

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    const config = {
      headers: {
        "Content-Type": "application/json",
      },
    };
    const response = await Axios.post(
      "http://127.0.0.1:8000/api/recipient/update-user/",
      formData,
      config
    );
    console.log(response.data.message);
    if (response.data.message == "Login successful") {
      setIsLoggedIn(true);
    } else {
      setErrormsg(response.data.message);
    }
  };
  
  return (
    <div className="container1">
     
        <div className="leftrectangle1">
         <div className="title1">
           SKILLBADGE
         </div>
         <div className="line1">
         </div>
         <div className="firstoption1" onClick={()=>navigate('/user')}>
           <div className="icon1">
            
  <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none">
<rect width="24" height="24" fill="None"/>
<path fill-rule="evenodd" clip-rule="evenodd" d="M8 7C8 5.93913 8.42143 4.92172 9.17157 4.17157C9.92172 3.42143 10.9391 3 12 3C13.0609 3 14.0783 3.42143 14.8284 4.17157C15.5786 4.92172 16 5.93913 16 7C16 8.06087 15.5786 9.07828 14.8284 9.82843C14.0783 10.5786 13.0609 11 12 11C10.9391 11 9.92172 10.5786 9.17157 9.82843C8.42143 9.07828 8 8.06087 8 7ZM8 13C6.67392 13 5.40215 13.5268 4.46447 14.4645C3.52678 15.4021 3 16.6739 3 18C3 18.7956 3.31607 19.5587 3.87868 20.1213C4.44129 20.6839 5.20435 21 6 21H18C18.7956 21 19.5587 20.6839 20.1213 20.1213C20.6839 19.5587 21 18.7956 21 18C21 16.6739 20.4732 15.4021 19.5355 14.4645C18.5979 13.5268 17.3261 13 16 13H8Z" fill="#F5EBEB"/>
</svg>
           </div>
           <div className="text1">
            User Profile
           </div>
  </div>
      
         <div className="secondoption1" onClick={()=>navigate('/allbadges')}>
           <div className="icon1">
           <svg xmlns="http://www.w3.org/2000/svg" width="25" height="24" viewBox="0 0 25 24" fill="none">
  <rect width="25" height="24" fill="None"/>
  <path d="M21.875 11C21.875 16.55 17.875 21.74 12.5 23C7.125 21.74 3.125 16.55 3.125 11V5L12.5 1L21.875 5V11ZM12.5 21C16.4062 20 19.7917 15.54 19.7917 11.22V6.3L12.5 3.18L5.20833 6.3V11.22C5.20833 15.54 8.59375 20 12.5 21ZM15.6771 16L12.4688 14.15L9.27083 16L10.1146 12.5L7.29167 10.16L11.0208 9.85L12.4688 6.55L13.9271 9.84L17.6562 10.15L14.8229 12.5L15.6771 16Z" fill="white"/>
  </svg>


           </div>
           <div className="text1">
             All Badge
           </div>
         </div>
         <div className="profileimage1">
         <svg xmlns="http://www.w3.org/2000/svg" width="88" height="80" viewBox="0 0 88 80" fill="None">
   <ellipse cx="44" cy="40" rx="44" ry="40" fill="white"/>
   </svg>
         </div>
         <div className="name1">
          {/* {{ Bhupendra Vaishnav}} */}
         
         </div>
         <div className="email1">
           {/* {{bhupendravaishnav9@gmail.com}}  */}
         </div>
      </div>


      {/* form */}
       <div class="rightrectangle1">
       
         <div className="background">
        <form onSubmit={onSubmitHandler}>
          <h3>Profile</h3>
          {isLoggedIn ? (
            <p className="errormsg">123</p>
          ) : (
            <p className="errormsg">{errormsg}</p>
          )}
          <div className="form-feilds">
            <div className="left">
              <label htmlFor="username">Name</label>
              <input
                onChange={onChangeInput}
                value={name}
                type="text"
                placeholder="Enter Name"
                name="name"
                required
              />
              
              <label htmlFor="password">Password</label>
              <input
                value={password}
                onChange={onChangeInput}
                type="password"
                placeholder="Enter Password"
                id="password"
                name="password"
                required
              />
            </div>
            <div className="right">
              
              <label htmlFor="contact_info">Contact Info</label>
              <input
                value={contact_info}
                onChange={onChangeInput}
                type="text"
                placeholder="Enter Contact Info"
                id="contact_info"
                name="contact_info"
                required
              />
              <label htmlFor="confirm_password">Confirm Password</label>
              <input
                value={confirm_password}
                onChange={onChangeInput}
                type="text"
                placeholder="Enter Confirm Password"
                id="confirm_password"
                name="confirm_password"
                required
              />
            </div>
          </div>
          <button type="submit">Submit</button>
          <a href="/login">Already Registered? Sign-In</a>
        </form>
      </div>
       
       </div>
      
      </div>
    );
}

export default EditProfile
